        [UnitOfWork]
        public void CreateTenants()
        {

            Random rnd = new Random();
            int counter = 0;

            var defaultEdition = _context.Editions.IgnoreQueryFilters().FirstOrDefault(e => e.Name == EditionManager.DefaultEditionName);
            var defaultCurrenyId = _context.Currencies.Where(c => c.Code == "SGD").FirstOrDefault().Id;
            var possibleCustomerTypeIds = _context.CustomerTypes.Select(c => c.Id).ToList();

            // Customers

            bool createCustomers = true;

            var customers = _context.Customers.ToList();
            if (customers.Count > 0)
            {
                var lastCustomer = customers.Last();
                if (businessNames.Contains(lastCustomer.Name))
                {
                    createCustomers = false;
                };
            }

            if (createCustomers)
            {
                do
                {
                    string tenancyName = string.Format("{0}-{1}", businessNames[counter].Replace(" ", "").Substring(0, 3), Guid.NewGuid().ToString().Substring(0, 3)).ToUpper();

                    Tenant newTenant = new Tenant()
                    {
                        IsActive = true,
                        TenancyName = tenancyName,
                        EditionId = defaultEdition.Id,
                        TenantType = "C",
                        IsInTrialPeriod = false,
                        Name = businessNames[counter]
                    };

                    Tenant createdTenant = _context.Tenants.Add(newTenant).Entity;
                    _context.SaveChanges();

                    Customer newCustomer = new Customer()
                    {
                        CurrencyId = defaultCurrenyId,
                        CustomerTypeId = possibleCustomerTypeIds[rnd.Next(0, possibleCustomerTypeIds.Count - 1)],
                        Identifier = tenancyName,
                        Name = businessNames[counter],
                        Reference = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                        TenantId = createdTenant.Id,
                        CustomerLoc8UUID = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                        LogoUrl = logoUrls[counter],
                        Website = websites[counter]
                    };

                    Customer createdCustomer = _context.Customers.Add(newCustomer).Entity;
                    _context.SaveChanges();

                    Address newAddress = new Address()
                    {
                        CustomerId = createdCustomer.Id,
                        AddressEntryName = string.Format("{0} head office", createdCustomer.Name),
