        [UnitOfWork]
        private void CreateAssets()
        {
            // Assets

            var assetOwners = _context.AssetOwners.ToList();
            Random rnd = new Random();

            var assets = _context.Assets.ToList();
            var assetOwnerships = _context.AssetOwnerships.ToList();
            var assetClasses = _context.AssetClasses.ToList();
            var assetStatuses = _context.AssetStatuses.ToList();

            foreach (var assetOwner in assetOwners)
            {
                var ownedAssets = assetOwnerships.Where(o => o.AssetOwnerId == assetOwner.Id).ToList();
                if (ownedAssets.Count < numberOfAssetsForEachAssetOwner)
                {
                    for (int i = 0; i < numberOfAssetsForEachAssetOwner; i++)
                    {
                        Asset newAsset = new Asset()
                        {
                            AssetClassId = assetClasses[rnd.Next(0, assetClasses.Count() - 1)].Id,
                            AssetLoc8GUID = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                            AssetStatusId = assetStatuses[rnd.Next(0, assetStatuses.Count() - 1)].Id,
                            ChassisNo = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                            Description = string.Format("{0} @{1} ", randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)], assetOwner.Identifier),
                            EngineNo = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                            IsExternalAsset = (rnd.Next(0, 5) == 3) ? true : false,
                            Location = cityList[rnd.Next(0, cityList.Count() - 1)],
                            TenantId = assetOwner.TenantId,
                            PurchaseCost = rnd.Next(10000, 100000),
                            PurchaseDate = DateTime.UtcNow.AddDays(-rnd.Next(400, 1000)),
                            PurchaseOrderNo = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                            Reference = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                            SerialNumber = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                            VehicleRegistrationNo = string.Format("{0}-{1}", Guid.NewGuid().ToString().Substring(0, 3), Guid.NewGuid().ToString().Substring(0, 3)).ToUpper()
                        };

                        var createdAsset = _context.Assets.Add(newAsset).Entity;

                        AssetOwnership newAssetOwnership = new AssetOwnership()
                        {
                            AssetId = createdAsset.Id,
                            AssetOwnerId = assetOwner.Id,
                            FinishDate = DateTime.UtcNow.AddDays(rnd.Next(400, 1000)),
                            PercentageOwnership = 100,
                            StartDate = DateTime.UtcNow.AddDays(-rnd.Next(400, 1000)),
                            TenantId = assetOwner.TenantId
                        };

                        _context.AssetOwnerships.Add(newAssetOwnership);
                        _context.SaveChanges();

                    }
                }
            }
        }
        [UnitOfWork]
        private void CreateLeaseAgeements()
        {
            // Lease Agreements

            Random rnd = new Random();

            var assignedAssetIds = _context.LeaseItems.Select(l => l.AssetId).Distinct().ToList();
            var availableAssets = _context.AssetOwnerships.Include(a => a.AssetFk).Where(a => !assignedAssetIds.Contains(a.AssetFk.Id)).Distinct().ToList();

            var customersWithALeaseIds = _context.LeaseAgreements.Select(l => l.CustomerId).Distinct().ToList();
            var CustomersWhoNeedALease = _context.Customers.Where(c => !customersWithALeaseIds.Contains(c.Id)).ToList();

            if (CustomersWhoNeedALease.Count() > 0 && availableAssets.Count() > 0)
            {
                var leaseItemsPerLease = availableAssets.Count() / (CustomersWhoNeedALease.Count() * leaseAgreementsPerCustomer);


                foreach (var customer in CustomersWhoNeedALease)
                {
                    for (int i = 0; i < leaseAgreementsPerCustomer; i++)
                    {
                        assignedAssetIds = _context.LeaseItems.Select(l => l.AssetId).Distinct().ToList();
                        availableAssets = _context.AssetOwnerships.Include(a => a.AssetFk).Include(a => a.AssetFk.AssetClassFk).Where(a => !assignedAssetIds.Contains(a.AssetFk.Id)).Distinct().ToList();


                        if (availableAssets.Count() >= leaseItemsPerLease)
                        {
                            // Create the lease

                            var assetOwner = availableAssets.Select(a => a.AssetOwnerFk).First();
                            if (availableAssets.Where(a => a.AssetOwnerId == assetOwner.Id).Count() < leaseItemsPerLease)
                            {
                                assetOwner = availableAssets.Select(a => a.AssetOwnerFk).Last();
                            }

                            LeaseAgreement leaseAgreement = new LeaseAgreement()
                            {
                                AssetOwnerId = assetOwner.Id,
                                CustomerId = customer.Id,
                                Description = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                                EndDate = DateTime.UtcNow.AddDays(rnd.Next(400, 1000)),
                                StartDate = DateTime.UtcNow.AddDays(-rnd.Next(400, 1000)),
                                Reference = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                                TenantId = assetOwner.TenantId,
                                Terms = string.Format("{0}.  {1}.  {2}.", randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)], randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)], randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)]),
                                Title = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)].Split(' ').ToList().First()
                            };

                            var createdLeaseAgreement = _context.LeaseAgreements.Add(leaseAgreement).Entity;
                            _context.SaveChanges();

                            // Add Assets

                            var assetsToAdd = availableAssets.Take(leaseItemsPerLease).ToList();

                            foreach (var asset in assetsToAdd)
                            {
                                LeaseItem leaseItem = new LeaseItem()
                                {
                                    AllocationPercentage = 100,
                                    AssetClassId = asset.AssetFk.AssetClassId,
                                    AssetId = asset.AssetId,
                                    DateAllocated = createdLeaseAgreement.StartDate,
                                    DepositUomRefId = 1,
                                    Description = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                                    EndDate = leaseAgreement.EndDate,
                                    StartDate = leaseAgreement.StartDate,
                                    Item = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)].Split(' ').ToList().First(),
                                    LeaseAgreementId = createdLeaseAgreement.Id,
                                    RentalUomRefId = 1,
                                    Terms = string.Format("{0}.  {1}.  {2}.", randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)], randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)], randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)]),
                                    TenantId = createdLeaseAgreement.TenantId,
                                    UnitDepositRate = (decimal)rnd.Next(1000, 2000),
                                    UnitRentalRate = (decimal)rnd.Next(2000, 10000)
                                };

                                _context.LeaseItems.Add(leaseItem);
                                _context.SaveChanges();
                            }
                        }
                    }

                }
            }
        }

        [UnitOfWork]
        private void CreateContracts()
        {

            // Support Contracts

            Random rnd = new Random();

            var supportedAssetIds = _context.SupportItems.Select(l => l.AssetId).Distinct().ToList();
            var unsupportedAssets = _context.AssetOwnerships.Include(a => a.AssetFk).Where(a => !supportedAssetIds.Contains(a.AssetFk.Id)).Distinct().ToList();

            var vendorsWithSupportContractIds = _context.SupportContracts.Select(l => l.VendorId).Distinct().ToList();
            var vendorsWhoNeedASupportContract = _context.Vendors.Where(c => !vendorsWithSupportContractIds.Contains(c.Id)).ToList();

            if (vendorsWhoNeedASupportContract.Count() > 0 & unsupportedAssets.Count() > 0)
            {
                int supportItemsPerSupportContract = unsupportedAssets.Count() / (vendorsWhoNeedASupportContract.Count() * numberOfSupportContractPerVendor);

                for (int i = 0; i < numberOfSupportContractPerVendor; i++)
                {

                    foreach (var vendor in vendorsWhoNeedASupportContract)
                    {
                        for (int ii = 0; ii < supportItemsPerSupportContract; ii++)
                        {
                            supportedAssetIds = _context.SupportItems.Select(l => l.AssetId).Distinct().ToList();
                            unsupportedAssets = _context.AssetOwnerships.Include(a => a.AssetFk).Where(a => !supportedAssetIds.Contains(a.AssetFk.Id)).ToList();

                            if (unsupportedAssets.Count() >= supportItemsPerSupportContract)
                            {
                                // Create the Support Contract

                                var assetOwner = unsupportedAssets.Select(a => a.AssetOwnerFk).First();
                                if (unsupportedAssets.Where(a => a.AssetOwnerId == assetOwner.Id).Count() < supportItemsPerSupportContract)
                                {
                                    assetOwner = unsupportedAssets.Select(a => a.AssetOwnerFk).Last();
                                }

                                SupportContract supportContract = new SupportContract()
                                {
                                    AssetOwnerId = assetOwner.Id,
                                    VendorId = vendor.Id,
                                    Description = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                                    EndDate = DateTime.UtcNow.AddDays(rnd.Next(400, 1000)),
                                    StartDate = DateTime.UtcNow.AddDays(-rnd.Next(400, 1000)),
                                    Reference = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                                    TenantId = assetOwner.TenantId,
                                    Title = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)].Split(' ').ToList().First(),
                                    AcknowledgedAt = DateTime.UtcNow.AddDays(-rnd.Next(400, 1000)),
                                    AcknowledgedBy = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)].Split(' ').ToList().First(),
                                    IsAcknowledged = (rnd.Next(0, 4) == 3) ? true : false,
                                    IsRFQTemplate = (rnd.Next(0, 9) == 3) ? true : false,
                                };

                                var createdSupportContract = _context.SupportContracts.Add(supportContract).Entity;
                                _context.SaveChanges();

                                // Add Assets

                                var assetsToAdd = unsupportedAssets.Take(supportItemsPerSupportContract).ToList();
                                var availableConsumableTypeIds = _context.ConsumableTypes.Select(c => c.Id).ToList();
                                var availableUomIds = _context.Uoms.Select(c => c.Id).ToList();
                                var availableSupportTypeIds = _context.SupportTypes.Select(c => c.Id).ToList();

                                foreach (var asset in assetsToAdd)
                                {
                                    SupportItem supportItem = new SupportItem()
                                    {
                                        AssetClassId = asset.AssetFk.AssetClassId,
                                        AssetId = asset.AssetFk.Id,
                                        Description = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                                        TenantId = createdSupportContract.TenantId,
                                        ConsumableTypeId = availableConsumableTypeIds[rnd.Next(0, availableConsumableTypeIds.Count() - 1)],
                                        Frequency = (decimal)rnd.Next(1, 30),
                                        IsAdHoc = (rnd.Next(0, 9) == 3) ? true : false,
                                        IsChargeable = (rnd.Next(0, 9) == 3) ? false : true,
                                        IsStandbyReplacementUnit = (rnd.Next(0, 9) == 3) ? true : false,
                                        SupportContractId = createdSupportContract.Id,
                                        UomId = (int)availableUomIds[rnd.Next(0, availableUomIds.Count() - 1)],
                                        SupportTypeId = availableSupportTypeIds[rnd.Next(0, availableSupportTypeIds.Count() - 1)],
                                        UnitPrice = (decimal)rnd.Next(100, 2000)
                                    };

                                    _context.SupportItems.Add(supportItem);
                                    _context.SaveChanges();
                                }
                            }
                        }

                    }
                }
            }
        }

        [UnitOfWork]
        private void CreateIncidents()
        {
            // Incidents

            var customers = _context.Customers.ToList();
            Random rnd = new Random();

            var existingIncidentCount = _context.Incidents.Count();

            if (existingIncidentCount < numberOfIncidentsToCreate)
            {
                var possiblePriorities = _context.IncidentPriorities.ToList();
                var possibleStatuses = _context.IncidentStatuses.ToList();
                var possibleTypes = _context.IncidentTypes.ToList();


                for (int i = 0; i < numberOfIncidentsToCreate - existingIncidentCount; i++)
                {
                    bool resolved = (rnd.Next(0, 2) == 1) ? false : true;
                    var customer = customers[rnd.Next(0, customers.Count() - 1)];

                    var leaseAgreements = _context.LeaseAgreements.Where(l => l.CustomerId == customer.Id).ToList();
                    var leaseAgreement = leaseAgreements[rnd.Next(0, leaseAgreements.Count() - 1)];
                    var leaseItems = _context.LeaseItems.Include(l => l.AssetFk).Where(l => l.LeaseAgreementId == leaseAgreement.Id).ToList();
                    var leaseItem = leaseItems[rnd.Next(0, leaseItems.Count() - 1)];
                    var supportItem = _context.SupportItems.Where(s => s.AssetId == leaseItem.AssetId).FirstOrDefault();
                    int? supportItemId = (supportItem != null) ? supportItem.Id : (int?)null;
                    var users = _context.Users.IgnoreQueryFilters().Where(u => u.TenantId == customer.TenantId).ToList();

                    Incident newIncident = new Incident()
                    {
                        AssetId = leaseItem.AssetId,
                        CustomerId = customer.Id,
                        Description = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                        IncidentDate = DateTime.UtcNow.AddDays(-rnd.Next(400, 1000)),
                        IncidentPriorityId = possiblePriorities[rnd.Next(0, possiblePriorities.Count() - 1)].Id,
                        IncidentStatusId = possibleStatuses[rnd.Next(0, possibleStatuses.Count() - 1)].Id,
                        IncidentTypeId = possibleTypes[rnd.Next(0, possibleTypes.Count() - 1)].Id,
                        Location = string.Format("{0} {1}, {2}", addressLine2List[rnd.Next(0, addressLine2List.Count() - 1)], randomStreetDefs[rnd.Next(0, randomStreetDefs.Count - 1)], stateList[rnd.Next(0, stateList.Count - 1)]),
                        Remarks = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                        ResolvedAt = (resolved) ? DateTime.UtcNow.AddDays(-rnd.Next(1, 400)) : (DateTime?)null,
                        SupportItemId = supportItemId,
                        TenantId = customer.TenantId,
                        UserId = users[rnd.Next(0, users.Count() - 1)].Id
                    };

                    var createdIncident = _context.Incidents.Add(newIncident).Entity;
                    _context.SaveChanges();

                    for (int ii = 0; ii < rnd.Next(minNumberOfIncidentUpdatesPerIncident, maxNumberOfIncidentUpdatesPerIncident); ii++)
                    {
                        IncidentUpdate newIncidentUpdate = new IncidentUpdate()
                        {
                            IncidentId = createdIncident.Id,
                            TenantId = customer.TenantId,
                            Update = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                            Updated = DateTime.UtcNow.AddDays(-rnd.Next(400, 1000)),
                            UserId = users[rnd.Next(0, users.Count() - 1)].Id
                        };

                        _context.IncidentUpdates.Add(newIncidentUpdate);
                        _context.SaveChanges();
                    }
                }
            }
        }

        [UnitOfWork]
        private void CreateWorkOrders()
        {

            // WorkOrders

            Random rnd = new Random();

            var existingWorkOrderCount = _context.WorkOrders.Count();
            var incidents = _context.Incidents.IgnoreQueryFilters().Include(g => g.SupportItemFk.SupportContractFk).Include(g => g.AssetFk).Include(g => g.CustomerFk).Include(g => g.UserFk).ToList();

            if (existingWorkOrderCount < incidents.Count())
            {
                var possiblePriorities = _context.WorkOrderPriorities.ToList();
                var possibleStatuses = _context.WorkOrderStatuses.ToList();
                var possibleTypes = _context.WorkOrderTypes.ToList();
                var possibleActions = _context.WorkOrderActions.ToList();

                foreach (var incident in incidents)
                {
                    var supportItem = _context.SupportItems.Where(s => s.AssetId == incident.AssetId).FirstOrDefault();
                    var assetOwnership = _context.AssetOwnerships.Include(a => a.AssetOwnerFk).Where(a => a.AssetId == incident.AssetId).FirstOrDefault();
                    var status = possibleStatuses[rnd.Next(0, possibleStatuses.Count() - 1)];

                    var endDate = (status.Status == "Completed") ? DateTime.UtcNow.AddDays(-rnd.Next(10, 50)) : (DateTime?)null;

                    WorkOrder newWorkOrder = new WorkOrder()
                    {
                        IncidentId = incident.Id,
                        CustomerId = incident.CustomerId,
                        Description = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                        WorkOrderPriorityId = possiblePriorities[rnd.Next(0, possiblePriorities.Count() - 1)].Id,
                        WorkOrderStatusId = status.Id,
                        WorkOrderTypeId = possibleTypes[rnd.Next(0, possibleTypes.Count() - 1)].Id,
                        Location = string.Format("{0} {1}, {2}", addressLine2List[rnd.Next(0, addressLine2List.Count() - 1)], randomStreetDefs[rnd.Next(0, randomStreetDefs.Count - 1)], stateList[rnd.Next(0, stateList.Count - 1)]),
                        Remarks = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                        SupportItemId = supportItem.Id,
                        TenantId = incident.CustomerFk.TenantId,
                        UserId = incident.UserFk.Id,
                        AssetOwnershipId = assetOwnership.Id,
                        EndDate = endDate,
                        StartDate = DateTime.UtcNow.AddDays(-rnd.Next(50, 150)),
                        Loc8GUID = Guid.NewGuid().ToString().Substring(0, 16).Replace("-", "").ToUpper(),
                        Subject = string.Format("{0}...", randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)].Substring(0, 16)),
                        VendorId = (int)incident.SupportItemFk.SupportContractFk.VendorId
                    };

                    var createdWorkOrder = _context.WorkOrders.Add(newWorkOrder).Entity;
                    _context.SaveChanges();

                    for (int ii = 0; ii < rnd.Next(minNumberOfWorkOrderUpdatesPerWorkOrder, maxNumberOfWorkOrderUpdatesPerWorkOrder); ii++)
                    {
                        var action = possibleActions[rnd.Next(0, possibleActions.Count() - 1)];
                        WorkOrderUpdate newWorkOrderUpdate = new WorkOrderUpdate()
                        {
                            WorkOrderId = createdWorkOrder.Id,
                            TenantId = createdWorkOrder.TenantId,
                            Comments = randomDescriptions[rnd.Next(0, randomDescriptions.Count() - 1)],
                            WorkOrderActionId = action.Id
                            //UpdatedAt = DateTime.UtcNow.AddDays(-rnd.Next(50, 150)),
                            //Complete = (createdWorkOrder.EndDate != null) ? true : false,
                            //UpdatedByUserId = createdWorkOrder.UserId
                        };

                        _context.WorkOrderUpdates.Add(newWorkOrderUpdate);
                        _context.SaveChanges();
                    }
                }
            }
        }
    }
